import * as React from "react";
import "./Matching.css";

import Navbars from "../Navbar/navbarHome2.js";
import Drawer from "../Drawer/Drawer";
import {
  FaLanguage,
  FaFile,
  FaLongArrowAltLeft,
  FaLongArrowAltRight,
} from "react-icons/fa";
import { MdArrowDropDown } from "react-icons/md";

import { Box, Autocomplete, TextField } from "@mui/material";
import { data } from "../Data/data";

const Matching = () => {
  const [languages, setLanguages] = React.useState("");

  return (
    <div className="App-body-Order">
      <header className="App-header">
        <Navbars />
      </header>

      <Box sx={{ display: "flex", width: "100% " }}>
        <Drawer />

        <div style={{ marginTop: 60, height: 100 }}>
          <h4
            style={{
              fontWeight: 500,
              fontSize: 36,
              color: " #333333",
              marginLeft: 20,
              position: "absolute",
              top: "13%",
            }}
          >
            Translate
          </h4>
        </div>

        <div className="bodyMatching">
          <div style={{ margin: 30 }}>
            <p
              style={{
                textAlign: "start",
                color: "#034D82",
                fontWeight: 600,
                fontSize: 24,
              }}
            >
              Article
            </p>
            <div style={{ textAlign: "start" }}>
              <button className="buttonMatching">
                <FaLanguage className="iconsMatching" />
                <p className="textMatching">Text</p>
              </button>
              <button className="buttonMatching">
                <FaFile className="iconsMatching" />
                <p className="textMatching">File</p>
              </button>
            </div>
            <div>

              <div style={{float:"left"}}>
                <p
                  style={{
                    textAlign: "start",
                    color: "#353535",
                    fontSize: 18,
                    marginBottom: 20,
                  }}
                >
                  language
                </p>
                <Autocomplete
                  disablePortal
                  id="combo-box-demo"
                  options={data}
                  sx={{ width: 350 }}
                  renderInput={(params) => (
                    <TextField {...params} label="language" />
                  )}
                />
              </div>

             <div style={{ float:"left" ,width:30}}>
                <FaLongArrowAltRight  style={{position:"absolute"}}/>

                <FaLongArrowAltLeft style={{}}/>
              </div>

              <div style={{ float:"left"}}>
                <p
                  style={{
                    textAlign: "start",
                    color: "#353535",
                    fontSize: 18,
                    marginBottom: 20,
                  }}
                >
                  language
                </p>
                <Autocomplete
                  disablePortal
                  id="combo-box-demo"
                  options={data}
                  sx={{ width: 350 }}
                  renderInput={(params) => (
                    <TextField {...params} label="language" />
                  )}
                />
              </div>

            </div>
          </div>
        </div>
      </Box>
    </div>
  );
};

export default Matching;
